import styled from "styled-components";

const SideNavStyled = styled.nav`
  display: flex;
  flex-direction: column;
  border: 1px solid black;
  width: 16vw;
  height: 56.5em;
  position: sticky;
  top: 0;
`;

export default SideNavStyled;
